var $bm_rt;
var deltaX, deltaY;
deltaX = $bm_sub(thisComp.layer('origin').transform.xPosition, thisComp.layer('mouse').transform.xPosition);
deltaY = $bm_sub(thisComp.layer('origin').transform.yPosition, thisComp.layer('mouse').transform.yPosition);
var rad = Math.atan2(deltaY, deltaX);
var deg = $bm_mul(rad, $bm_div(180, Math.PI));
$bm_rt = $bm_sum(deg, 180);

